import '../App.css'
import { format } from 'date-fns'



interface Props {
    data: any
}


const Upcoming= ({data}: Props) => {
    const today:any = format(new Date(), "MM/dd/yy")


    
    let upcomingData = data.filter((e:any,o:number)=>(
        e.estimatedArrival >= today 
    )) 

    console.log(upcomingData[0])

    return (
        <div id='scroll' style={{ margin: "20px 0 0 0 ", height:"90%"}} >
            {upcomingData[0].status}
                {upcomingData.map((e:any,  i:number)=>{
                    return(
                        <div key={i} style={{width: "100%",}}>
                            {e.status}
                            {e.estimatedArrival}
                            {e.houseBillNumber }
                        </div>
                    )
                })}
        </div>
    )
}   

export default Upcoming;
